import React from 'react'
const Dashboard = () => {

        
	return (
        <div className="sec__one">
			 <DataTable
          title="Movies"
          columns={columns}
          data={movies}
          defaultSortFieldID={1}
          pagination
          paginationComponent={BootyPagination}
          selectableRows
          selectableRowsComponent={BootyCheckbox}
        />
        </div>
       )
}
export default Dashboard
